import React from 'react';
import searchContext from "./context";
import './index.css';

function UserList () {
        const { usersArray } = React.useContext(searchContext);
        return (
            <div>
                {usersArray.map(user =>
                    <li className='list'>{user}</li>)}
            </div>
        )
}

export default UserList;
